import React from 'react';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, Button, Typography } from '@mui/material';
import { scrapeProduct, storeSearchVolume } from '../services/api';

const ProductList = ({ products, onDelete, onStoreSearchVolume }) => {

    const handleScrapeProduct = async (productId) => {
        try {
            const response = await scrapeProduct(productId);
            if (response && response.message === "Scraper started in the background") {
                alert('Scraper started successfully');
            } else {
                alert('Error starting scraper');
            }
        } catch (error) {
            console.error('Error starting scraper for ' + productId, error);
        }
    };

    return (
        <TableContainer component={Paper}>
            <Typography variant="h4" component="h2" style={{ margin: '16px' }}>
                Product List
            </Typography>
            <Table>
                <TableHead>
                    <TableRow>
                        <TableCell>ID</TableCell>
                        <TableCell>Name</TableCell>
                        <TableCell>Image</TableCell>
                        <TableCell>Last Scraped</TableCell>
                        <TableCell>Actions</TableCell>
                    </TableRow>
                </TableHead>
                <TableBody>
                    {products.map(product => (
                        product ? (
                            <TableRow key={product.id}>
                                <TableCell>{product.id}</TableCell>
                                <TableCell>{product.name}</TableCell>
                                <TableCell>{product.image_url}</TableCell>
                                <TableCell>{product.last_updated}</TableCell>
                                <TableCell>
                                    <Button
                                        variant="contained"
                                        color="secondary"
                                        style={{ margin: '10px' }}
                                        onClick={() => onDelete(product.id)}
                                    >
                                        Delete
                                    </Button>
                                    <Button
                                        variant="contained"
                                        color="primary"
                                        onClick={() => handleScrapeProduct(product.id)}
                                    >
                                        Scrape
                                    </Button>
                                    <Button 
                                        variant="contained" 
                                        onClick={() => onStoreSearchVolume(product.id)} 
                                        style={{ marginLeft: '10px' }}
                                    >
                                        Store Search Volume
                                    </Button>
                                </TableCell>
                            </TableRow>
                        ) : null
                    ))}
                </TableBody>
            </Table>
        </TableContainer>
    );
};

export default ProductList;
